import logo from '../Image/Logo.png'
import iconMyPack from '../Image/icon 1.png'
import axios from 'axios';
import React from 'react';
function App() {
  axios.get(`https://tiktok.fullstack.edu.vn/api/users/search?q=hoaa&type=less`).then(res =>{

    console.log(res);
  } );

  return (
    <div className="background">
      <div className='logo' >
          <img src={logo} alt='abc'/>
      </div>
      <div className='MyPacks'>          
      </div>
      <img className='icon' src={iconMyPack} alt='abc'/>
      <p className='MyPack-text'>my packs</p>
    </div>

  );
}

export default App;
